import React, { Component } from 'react';
import css3 from './assets/icons/css3.svg';

class Projects extends Component {
  state = {  }
  render() { 
    return (
      <div style={styles.fill}>
      Horizon
      <div><img src={css3} /></div>
      </div>
    );
  }
}

export default Projects;

const styles = {}

styles.fill={
  position: 'absolute',
  backgroundColor: 'rgb(255,230, 60',
  width: '100vw',
  height: '100vh',
}
